export default function TodoList() {
  const { todo } = useTodos();
  return (
    <table>
      <tbody>
        {
          // 3
          todo.map((todo, i) => (
            <Todo key={i} {...todo} />
          ))
        }
      </tbody>
    </table>
  );
}

